    "2016-07-27T23:02:54.837444",nt"name": "proposal-for-the-designation-of-izembek-lagoon-as-a-wetland-of-international-importance-un",nt"isopen":
    false,nt"url": null,nt"notes": "Izembek Lagoon is a marine embayment containing
    what are probably the largest eelgrass (Zostera marina) beds in the world. The eelgrass
    beds are an important source of food for migratory birds with as many as 150,000
    ducks and 300,000 geese using the area during fall migration. Nearly the entire
    eastern Pacific coast population of brant (Branta bernicla nigricans) feed and stage
    in the lagoon in fall and a large percentage of the world population of Steller's
    eider (Polysticta stelleri) and emperor goose (Chen canagica) also use the area.",nt"license_title":
